import React from "react";

function Education() {
  return (
    <section>
      <h2>Eğitim Bilgileri</h2>
      <p>Üniversite: Kapadokya Üniversitesi</p>
      <p>Bölüm: Bilgisayar Programcılığı</p>
      <p>Mezuniyet Yılı: 2025</p>
    </section>
  );
}

export default Education;
